import {
    BoxBackground,
    InputField,
    Name,
    Background,
} from "./styles.js";

export default function Box() {
    return (
        <BoxBackground>

            <InputField>
                <Name>
                    Amount
                   </Name>
                <input type="number" placeholder='$' height="40px" width="200px" border-radius="8px" background-color="rgba(54,58,62,0.08)" margin-top="10px" />
            </InputField >

        </BoxBackground >
    );
}
